from collections import defaultdict
from typing import List


class Solution:
    #   https://leetcode.com/explore/challenge/card/february-leetcoding-challenge-2021/587/week-4-february-22nd-february-28th/3649
    #   Time Limit Exceeded
    def findLongestWord0(self, s: str, d: List[str]) -> str:
        if s is None or 0 == len(s) or d is None or 0 == len(d):
            return ''

        TRIE = lambda: defaultdict(TRIE)
        trie = TRIE()
        for word in d:
            t = trie
            for c in word:
                t = t[c]
            t['$'] = True

        self.res = []
        def find(t, acc, word):
            if '$' in t and t['$'] == True:
                cur = ''.join(acc)
                if 0 == len(self.res) or len(self.res[0]) < len(cur):
                    self.res = [cur]
                elif len(self.res[0]) == len(cur):
                    self.res.append(cur)
            for i, c in enumerate(word):
                if c not in t:
                    continue
                if 0 < len(self.res) and len(self.res[0]) > len(word[i + 1:]):
                    break
                acc.append(c)
                find(t[c], acc, word[i + 1:])
                acc.pop()

        if 0 == len(self.res):
            return ''
        find(trie, [], s)
        self.res.sort()
        return self.res[0]

    #   runtime; 536ms, 47.01%
    #   memory; 16.8MB, 66.00%
    def findLongestWord(self, s: str, d: List[str]) -> str:
        if s is None or 0 == len(s) or d is None or 0 == len(d):
            return ''

        lenS = len(s)
        def isIncluded(word):
            w, c = 0, 0
            while c < lenS and w < len(word):
                if word[w] == s[c]:
                    w += 1
                    c += 1
                else:
                    c += 1
            return w == len(word)

        for word in sorted(d, key=lambda w: (-len(w), w)):
            if isIncluded(word):
                return word
        return ''


